import React from "react";
import { GrInstagram } from "react-icons/gr";
import { FaFacebookSquare } from "react-icons/fa";
import { SiBloglovin } from "react-icons/si";

function Tail() {
  return (
    <div className="bg-red-200">
      <div className="max-w-5xl py-4 mx-auto flex flex-col">
        <div className="flex justify-between">
          <div className="flex"></div>
          <div></div>
        </div>
        <div className="flex justify-between">
          <h4>대구아이캔 | 대구광역시 중구 국채보상로 123길 16, 3층 </h4>
          <h4>대표번호 : 053-242-5454 사업자등록번호 513-61-00074</h4>
          <div className="flex">
            <GrInstagram className="text-2xl mx-1" />
            <FaFacebookSquare className="text-2xl mx-1" />
            <SiBloglovin className="text-2xl mx-1" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Tail;
